import { useEffect } from "react";

export const MyComponent = (props) => {
	const date = new Date();

	setTimeout (() => {
		date = new Date();}, 1000)

	useEffect(() => {
		console.log(date);
	}, []);

	return (
		<div>{String(date)}</div>
	)
};
